import React, { Component } from 'react';
import { ValueConsumer } from '../../../Context';

class ProceedItems extends Component {
    render() {
        return (
            <ValueConsumer>{value =>
                <div class="proceedItems">
                    <p>{value.cart.count} items</p>
                    <p>:</p>
                    <p>₹{value.cart.total}</p>
                    <s>₹{value.cart.mrp}</s>
                </div>
            }</ValueConsumer>
        )
    }
}

export default ProceedItems
